import React from 'react';
import { ChartContainer } from './style';

const CandleChart = ({ symbol, currentPrice }) => {
    return (
        <ChartContainer>
            <h3>{symbol} - Gráfico de Candlestick</h3>
            <div className="chart-placeholder">
                {/* Espaço para o gráfico fictício */}
                <div className="candle-sample">
                    <div className="up-day"></div>
                    <div className="down-day"></div>
                    <div className="up-day"></div>
                </div>
            </div>
            <div className="current-price">
                Preço atual: R$ {currentPrice}
            </div>
        </ChartContainer>
    );
};

export default CandleChart;
